import React from "react";
import { ContentHeader, PortfolioData } from "config/C4";

const PortfolioView = () => {
  return (
    <div className="portfolioView">
      <ContentHeader title="Portfolio" />
      <div className="portfolioView__items">
        {PortfolioData &&
          PortfolioData.map((item, i) => (
            <div className="portfolio__items--item" key={i}>
              {item.slug === "studio-pixels-and-code" ? (
                <img
                  src={
                    require(`../../assets/images/portfolio/${item.slug}-thumb.png`)
                      .default
                  }
                  alt={item.name}
                />
              ) : (
                <img
                  src={
                    require(`../../assets/images/portfolio/studio-pixels-and-code-thumb.png`)
                      .default
                  }
                  alt={item.name}
                />
              )}

              <h2>{item.name}</h2>
            </div>
          ))}
      </div>
    </div>
  );
};

export default PortfolioView;
